INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2173','2993','1','','http://www1.ycsyy.com/upload/images/2019/11/715a80ce1db45a6b.png','2019年7月19日下午，市一院离退休干部处邀请市消防队的教官为老同志们作消防知识讲座。','192.168.162.110','192.168.162.110','1563465600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2019年7月19日下午，市一院离退休干部处邀请市消防队的教官为老同志们作消防知识讲座。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/715a80ce1db45a6b.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/23cf714af7a660b8.png\" title=\"image.png\" alt=\"image.png\" width=\"542\" height=\"344\" style=\"width: 542px; height: 344px;\" /></span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2174','2994','1','','http://www1.ycsyy.com/upload/images/2019/11/245709ba8f6c5789.png','春意盎然，春风送暖。为深入学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神，以“讴歌新时代，增添正能量，我看新中国成立70周年”主题教育活动开展为载体，进一步丰富我院离退休党员干部职工的精神文化生活。按照院党委要求，2019年5月9日，市一院老干部支','192.168.162.110','192.168.162.110','1557331200','<p style=\"text-indent: 57px; line-height: 3em;\"><span style=\"letter-spacing: 1px; font-size: 20px; font-family: 宋体, SimSun;\">春意盎然，春风送暖。为深入学习贯彻习近平新时代中国特色社会主义思想和党的十九大精神，以“讴歌新时代，增添正能量，我看新中国成立70周年”主题教育活动开展为载体，进一步丰富我院离退休党员干部职工的精神文化生活。按照院党委要求，2019年5月9日，市一院老干部支部组织全院140多名离退休党员同志赴淮安红色文化教育和历史文化教育基地，开展党日活动现场教学。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/245709ba8f6c5789.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">周恩来同志是伟大的马克思主义者，伟大的无产阶级革命家、政治家、军事家、外交家，党和国家主要领导人之一，中国人民解放军主要创建人之一，中华人民共和国的开国元勋，是以毛泽东同志为核心的党的第一代中央领导集体的重要成员。他的卓著功勋、崇高品德、光辉人格，深深铭记在全国各族人民心中。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在纪念馆中，老党员同志们学习了周恩来同志的家世家风，了解了他投身革命的光辉历程，倾听了他许多大公无私的感人事迹。在周恩来同志的铜像面前，支部的党员同志们重温入党誓词。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/575b9d7c9318fdcc.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9398f9c4101a96fd.png\" border=\"0\" /></span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/70510753491b402b.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">不忘初心跟党走，牢记使命勇担当。此次的党日活动，院离退休干部处在医院党委的指导下，精心准备、认真组织，整个活动受到了广大老党员同志们的交口称赞，大家纷纷表示要发挥余热，为医院的基层党建添砖加瓦，为推动医院高质量发展贡献力量。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/967f86e712ee86ad.png\" border=\"0\" /></span></p>','','','','','');
