 style=\"font-family: 宋体, SimSun; font-size: 20px;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/66ae122a2e3facf1.png\" border=\"0\" /></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"text-indent: 59px; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><br /></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年10月11日上午，我院离退休干部处组织部分离退休老同志开展投掷羽毛球比赛，比赛现场热闹纷呈。瞧大家赛的多认真，玩得多开心！</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span><img src=\"http://www1.ycsyy.com/upload/images/2019/11/a9be502eb6a348db.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9010e83b1fdd2a2f.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/86b9df37fa52b4d6.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/33434c6ae09fb7ab.png\" border=\"0\" /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/9e157d423da2432e.png\" border=\"0\" /></p><p style=\"margin-left: 15px; text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">获奖了！！！</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e40f6581bef12fd7.png\" border=\"0\" /></p>','','','','','');
