INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2178','2998','1','','http://www1.ycsyy.com/upload/images/2019/11/753cefe603573e85.png','为深入推进我院离退休党员干部“两学一做”学习教育活动，巩固大家一年来的学习成果，进一步提高我院离退休党员干部的综合素质，在建党96周年到来之际，我院老干部支部开展了离退休党员党建知识竞赛活动。通过抢答、笔试的激烈争夺，徐国旭、冯荣亮等二名同志获一等奖，','192.168.162.110','192.168.162.110','1512057600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为深入推进我院离退休党员干部“两学一做”学习教育活动，巩固大家一年来的学习成果，进一步提高我院离退休党员干部的综合素质，在建党96周年到来之际，我院老干部支部开展了离退休党员党建知识竞赛活动。通过抢答、笔试的激烈争夺，徐国旭、冯荣亮等二名同志获一等奖，程树星、郭松林、徐杏棣、李德贵等四名同志获二等奖，候玉珍、周增宽、左明礼、夏玲、陈仁万、周美和等六名同志获三等奖。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/753cefe603573e85.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/8130a05ea43a007f.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/ad82666edae6348c.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/e34cab5c20318cf4.png\" title=\"image.png\" alt=\"image.png\" width=\"314\" height=\"250\" style=\"width: 314px; height: 250px;\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3d86b5ab666dba2e.png\" title=\"image.png\" alt=\"image.png\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b1bf1ef05eb9f9ad.png\" title=\"image.png\" alt=\"image.png\" width=\"317\" height=\"245\" style=\"width: 317px; height: 245px;\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c5e9c2ed23f7730e.png\" title=\"image.png\" alt=\"image.png\" /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span><br /></p>','','',