INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2179','2999','1','','http://www1.ycsyy.com/upload/images/2019/11/b0d0aedb3a2c7549.png','在2017年国庆、中秋、重阳佳节来临之际， 10月5号市一院离退休职工“庆国庆、度中秋、迎重阳”系列活动拉开了帷幕。老干部踊跃参加，纷纷用行到表达对建国七十周年的热爱。王志才、张孝琴夺走了掼蛋比赛的桂冠；李德贵荣获象棋比赛的第一名；杨忠达获书画比赛第一名。','192.168.162.110','192.168.162.110','1507132800','<p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">在2017年国庆、中秋、重阳佳节来临之际， 10月5号市一院离退休职工“庆国庆、度中秋、迎重阳”系列活动拉开了帷幕。老干部踊跃参加，纷纷用行到表达对建国七十周年的热爱。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\">王志才、张孝琴夺走了掼蛋比赛的桂冠；李德贵荣获象棋比赛的第一名；杨忠达获书画比赛第一名。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b0d0aedb3a2c7549.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/be4a4bacb881ed00.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/70236261e9fce3dd.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/13d1ff4e1c4bdaba.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/a27a842be2086f61.png\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2059ce091703a280.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2180','3000','1','','http://www1.ycsyy.com/upload/images/2019/11/2196def87d5e4497.png','2017年9月19日下午，在院领导的关心下，在医院南区办公室的大力支持下，我院离退休干部处组织了部分离退休老同志参观了盐城市第一人民医院南区，让老同志实地了解医院发展的大好形 山册册势，分享医院发展成果，进一步促进老领导、老同志对医院工作的理解与支持。老同志','192.168.162.110','192.168.162.110','1505750400','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2017年9月19日下午，在院领导的关心下，在医院南区办公室的大力支持下，我院离退休干部处组织了部分离退休老同志参观了盐城市第一人民医院南区，让老同志实地了解医院发展的大好形 山册册势，分享医院发展成果，进一步促进老领导、老同志对医院工作的理解与支持。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2196def87d5e4497.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们正津津有味地听办公室小罗给大家介绍医院南区的情况</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/34132621d752a147.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f0b6f9b56b8fe7dc.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/940e2419b9c794d.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们边走边看，连连称赞我们医院南区真漂亮！医院发展真快！</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/89353f76fbcfd0d5.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们在门诊药房参观了药房自动发药流程系统，直感叹高科技就是神奇！</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/25a3520cbd92bd23.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/49020444bb939af0.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/7573a115c22d2b38.png\" border=\"0\" /></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">手术室护士长和消化科护士长热情地给大家介绍病区的情况，老同志们问东问西可感兴趣了。</span></p><p style=\"text-indent: 28px; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">老同志们兴趣勃勃地追着小罗问这问那，恨不得把自己不清楚的事一下子全弄明白</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/f17bfa6eb8f99c1c.png\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/ee3b0495f2357b07.png\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2181','3001','1','','http://www1.ycsyy.com/upload/images/2019/11/5a7fd8f7f5d329df.jpg','为丰富我院离退休干部职工的精神文化生活，受院党委的委托，我院离退休干部处及老干支部于4月18日和20日两天，分两批组织全院200多名离退休老同志赴南通如皋市水绘园、长寿园参观赏游。在和煦的春光中，老同志们参观了代表江南园林风格的如皋水绘园，兼具自然秀美和人文','192.168.162.110','192.168.162.110','1492617600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为丰富我院离退休干部职工的精神文化生活，受院党委的委托，我院离退休干部处及老干支部于4月18日和20日两天，分两批组织全院200多名离退休老同志赴南通如皋市水绘园、长寿园参观赏游。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在和煦的春光中，老同志们参观了代表江南园林风格的如皋水绘园，兼具自然秀美和人文底蕴的美景给老同志留下了极其深刻的印象。通过游览，老同志们了解了历史，开阔了眼界，锻炼了身体，颐养了身心。在长寿园，大家浏览了世界最大的寿星像，祈福长寿安康。此外还组织老同志到如皋园艺馆和李昌钰刑侦博物馆赏花、参观，进一步开拓眼界。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">离退休干部处精心准备、悉心负责、考虑周全，整个参观考察活动安全顺畅愉悦，受到了广大老同志的交口称赞。此次活动的成功举办，也标志着老干部支部4月份党员活动日的一项重要内容圆满完成。</span></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/5a7fd8f7f5d329df.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3a985cef969b440f.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/addde6a66634f72e.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/6991b73812f2d86f.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/613163a92bec447e.jpg\" border=\"0\" /><img src=\"http://www1.ycsyy.com/upload/images/2019/11/3d3d2267df3521e7.jpg\" border=\"0\" /></p><p style=\"text-align: center;\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/cfe56896c410ed64.jpg\" border=\"0\" /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2182','3002','1','','http://www1.ycsyy.com/upload/images/2019/11/c3184c0df3c6fcb4.png','为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，2017年2月9日下午，我院离退休干部科在老干部活动中心组织开展了一次别开生面的猜灯谜活动。图为老同志们在活动现场积极参加猜谜活动。','192.168.162.110','192.168.162.110','1486569600','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，2017年2月9日下午，我院离退休干部科在老干部活动中心组织开展了一次别开生面的猜灯谜活动。图为老同志们在活动现场积极参加猜谜活动。</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/c3184c0df3c6fcb4.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/2d36d55f3716aeb8.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/b7a0de97761bf2c6.png\" border=\"0\" /></span></span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: center;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"><span style=\"font-size:21px;font-family: \'Times New Roman\',serif\"><img src=\"http://www1.ycsyy.com/upload/images/2019/11/34d41a93e6996868.png\" border=\"0\" /></span></span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2183','3003','1','','http://www1.ycsyy.com/upload/images/2019/11/123c6355883e0a25.jpg','各位离退休老同志：接省委、市委老干部局、离退休干部工委的通知精神，为庆祝中国共产党成立100周年，引导离退休干部讲好党的故事，传承红色基因，弘扬革命精神，特面向我院全体离退休老同志组织开展庆祝中国共产党成立100周年征文比赛。现将有关事项通知如下：一、征文','192.168.162.110','192.168.162.110','1619107200','<p style=\"line-height: 32px; text-align: left;\"><span style=\"font-family: 宋体; font-size: 19px;\">各位离退休老同志：</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">接省委、市委老干部局、离退休干部工委的通知精神，为庆祝中国共产党成立</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family:宋体\">周年，引导离退休干部讲好党的故事，传承红色基因，弘扬革命精神，特面向我院全体离退休老同志组织开展庆祝中国共产党成立</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family:宋体\">周年征文比赛。现将有关事项通知如下：</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">一、征文主题：围绕庆祝建党</span><span style=\"font-size:19px\">100</span><span style=\"font-size:19px;font-family: 宋体\">周年，结合亲身经历和所学所思，讲述在党的领导下投身革命、建设、改革的历史瞬间、感人故事和切身体会，讴歌和反映我们党的辉煌成就和宝贵经验，特别是展现新时代在以习近平同志为核心的党中央的坚强领导下，党和国家各项事业取得的历史性成就、发生的历史性变化，我市推进“四新盐城”建设取得的显著成绩，大力弘扬党的光荣传统和优良作风，唱响共产党好、社会主义好、改革开放好、伟大祖国好、各族人民好的主旋律。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">二、征文时间：从通知之日起到</span><span style=\"font-size:19px\">2021</span><span style=\"font-size:19px;font-family:宋体\">年</span><span style=\"font-size:19px\">5</span><span style=\"font-size:19px;font-family: 宋体\">月</span><span style=\"font-size: 19px\">22</span><span style=\"font-size:19px;font-family:宋体\">日为止。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">三、征文体裁：回忆录、散文、纪实文学、学习心得均可，字数一般不超过</span><span style=\"font-size:19px\">3000</span><span style=\"font-size:19px;font-family:宋体\">字。要求内容真实、语言流畅、情感真挚，须是原创作品。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">四、投稿邮箱：</span><span style=\"font-size:19px\">654151792@qq.com</span><span style=\"font-size:19px;font-family:宋体\">，邮件主题命名为“征文比赛</span><span style=\"font-size:19px\">+</span><span style=\"font-size:19px;font-family: 宋体\">作品题目</span><span style=\"font-size: 19px\">+</span><span style=\"font-size:19px;font-family:宋体\">作者姓名”。</span></p>\r\n<p style=\"text-indent:37px;line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">五、奖项设置：一等奖</span><span style=\"font-size:19px\">1</span><span style=\"font-size:19px;font-family: 宋体\">名，二等奖</span><span style=\"font-size:19px\">2</span><span style=\"font-size:19px;font-family: 宋体\">名，三等奖</span><span style=\"font-size:19px\">3</span><span style=\"font-size:19px;font-family: 宋体\">名，优秀奖若干名，对获奖者将发放一定的奖品。</span></p>\r\n<p style=\"line-height:32px\"><span style=\"font-size:19px;font-family:宋体\">（本次活动的解释权属于医院离退休干部处）</span></p>\r\n<p style=\"line-height: 32px; text-align: right;\"><span style=\"font-size:19px\"> </span></p>\r\n<p style=\"text-indent: 271px; line-height: 32px; text-align: right;\"><span style=\"font-size:19px;font-family:宋体\">盐城市第一人民医院离退休干部处</span></p>\r\n<p style=\"line-height: 32px; text-align: right;\"><span style=\"font-size:19px\">  2021</span><span style=\"font-size:19px;font-family:宋体\">年</span><span style=\"font-size:19px\">4</span><span style=\"font-size:19px;font-family:宋体\">月</span><span style=\"font-size:19px\">23</span><span style=\"font-size:19px;font-family: 宋体\">日</span></p>\r\n<p></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2184','3004','1','','','各位离退休老同志：大家好！经医院统一安排定于2021年4月1日至2021年4月6日（7：00-9：00）为全院离退休职工健康体检。请大家在规定的时间内携带本人身份证直接到体检中心参加体检。本次体检仅限本人，不得转让！体检结束后，务必将体检指引单留交体检中心，否则无法获','192.168.162.110','192.168.162.110','1615910400','<p><span style=\"font-family: 宋体; font-size: 18px;\"></span></p><p><span style=\"font-size: 18px;\"><br /></span></p><p style=\"text-indent: 0em; text-align: left;\"><span style=\"font-size: 18px;\">各位离退休老同志：</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 18px;\">大家好！</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 18px;\">经医院统一安排定于2021年4月1日至2021年4月6日（7：00-9：00）为全院离退休职工健康体检。请大家在规定的时间内携带本人身份证直接到体检中心参加体检。本次体检仅限本人，不得转让！体检结束后，务必将体检指引单留交体检中心，否则无法获取体检结果。体检报告在规定体检时间结束一周后，到院老年活动中心领取！请看到通知的老同志相互转告！</span></p><p style=\"text-indent: 2em;\"><span style=\"font-size: 19px; font-family: 宋体;\"><br /></span></p><p style=\"text-indent:280px\"><span style=\"font-size: 18px;\"></span></p><p style=\"text-indent: 280px; text-align: right;\"><span style=\"font-family: 宋体; font-size: 18px;\">离退休干部处</span></p><p style=\"text-indent: 299px; text-align: right;\"><span style=\"font-size: 18px;\">2021.3.17</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2185','3005','1','','','：全院离退休职工同志们正月十五是我国传统的元宵佳节，为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，离退休干部处将组织猪年“元宵灯谜”活动，欢迎广大离退休职工积极参与。活动时间：2019年2月19日下午2：30－3：00活动地点：','192.168.162.110','192.168.162.110','1549900800','<p style=\"line-height: 3em; text-indent: 0em;\"></p><p style=\"line-height: 3em; text-indent: 0em;\"></p><p style=\"line-height: 3em; text-indent: 0em; text-align: left;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px; text-indent: 2em;\">：全院离退休职工同志们</span><br /></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">正月十五是我国传统的元宵佳节，为丰富广大离退休干部的文化娱乐生活，让老同志们在欢乐、详和的气氛中迎接元宵佳节，离退休干部处将组织猪年“元宵灯谜”活动，欢迎广大离退休职工积极参与。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动时间：2019年2月19日下午2：30－3：00</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">活动地点：老干部支部活动室</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">市一院离退休干部处</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">二O一九年二月十二日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2186','3006','1','','','2018年是我国改革开放40周年。40年来，从城市到乡村，从衣食到住行，从脱贫攻坚到生态文明，中国社会发生了翻天覆地的变化。个人和家庭与国家的变革历程序紧紧相连、息息相关，我们伴随改革开放一路走来，亲历、见证了盐城墙0年来有目共睹、触手可及的巨大变化，感觉最','192.168.162.110','192.168.162.110','1544284800','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年是我国改革开放40周年。40年来，从城市到乡村，从衣食到住行，从脱贫攻坚到生态文明，中国社会发生了翻天覆地的变化。个人和家庭与国家的变革历程序紧紧相连、息息相关，我们伴随改革开放一路走来，亲历、见证了盐城墙0年来有目共睹、触手可及的巨大变化，感觉最真，情意最切，体会最深。为庆祝改革开放40周年，我院老干部支部组织开展“我看改革开放40年”主题征文活动。现将相关事宜通知如下：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">一、征文主题</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">“我看改革开放40年”，改革开放寻与者、奋斗者、见证者的心路与难忘记忆，反映盐城人在40年改革历程中的不懈努力，展示盐城人在新时代的崭新面貌。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">三、征文对象</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">面向组织关系在老干部支部的所有党员，欢迎大家踊跃投稿。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">四、征文要求</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">围绕40年来与改革开放紧密相连的城乡发展、时代变迁、生活和人生轨迹，以亲身经历的故事和身边点点滴滴的变化，以小见大，见微知著，从不同角度、不同侧面，反映改革开放大背景下盐城人民生产生活、风俗习惯、思想观念更新的真实图景，为盐城40年波澜壮阔的发展长卷留下细腻可感、动人心弦的个体“微历史”，鼓舞激励盐城人民沿着改革开放的道路继续前进，凝聚起同心建设“富美盐城”的磅礴力量。征文不限，有真情实感，主题鲜明、条理清晰、生动鲜活，有较强的可读性和感染力。字数控制在3000字以内。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">五、评选表彰</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">本次征文设特等奖、一等奖、二等奖、三等奖及优秀奖若干，对获奖者给予不同层次的奖励。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">六、投稿方式</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">纸质材料邮寄或直接送到老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">七、征文时间</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">即日起至2019年3月1日</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">盐城市第一人民医院老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年12月9日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2187','3007','1','','','：各位离退休党员为推动我院离退休干部党支部建设，2018年来我们离退休干部党支部继续开展了“夕阳生金辉、厚德耀盐城、增添正能量”主题活动，为积极引导全院离退休老干部为党和人民事业增添正能量，为建设新一院作出新的更大贡献，我院老干部支部在2019年新春来临之际','192.168.162.110','192.168.162.110','1544284800','<p style=\"line-height: 3em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休党员</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(51, 51, 51);\">为推动我院离退休干部党支部建设，2018年来我们离退休干部党支部继续开展了</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(34, 34, 34);\">“夕阳生金辉、厚德耀盐城、增添正能量”主题活动，为积极引导全院离退休老干部为党和人民事业增添正能量，为建设新一院作出新的更大贡献</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">，我院老干部支部在2019年新春来临之际，将评选表彰一批“正能量之星”。现将有关事项通知如下： </span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"line-height: 150%; color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">一、评选表彰的目的和意义</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">在离退休党员干部中评选表彰“正能量之星”,</span> <span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(51, 51, 51);\">旨在</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(34, 34, 34);\">充分发挥典型的示范引领作用，在离退休干部中营造积极向上的浓厚氛围，为建设新盐城提供强大的精神动力和道德支持，</span><span style=\"font-size: 20px; line-height: 150%; font-family: 宋体; color: rgb(81, 81, 81);\">对我院调动离退休干部党员自我教育、自我提高的积极性和主动性，充分发挥离退休干部党员的先锋模范作用，具有重要意义。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">二、评选表彰的标准:</span></strong> </span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">(</span></strong><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">一)学习之星 </span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）注重政治理论学习，在政治思想上行动上与党中央保持一致；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）积极参加各类学习活动，并在活动中起带头作用；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）喜欢并积极学习新知识，新技能、新技术，不断丰富知识体系；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）通过自学或上老年学校，学习并掌握1－2门专业知识或技能；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）能运用自己学习成果改变身边老同志对待学习的态度。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（二）健康之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）拥有健康的生活理念和生活方式，并宣传积极养老观念和健康生活理念；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）心理健康。保持积极健康乐观的心态，看待问题客观，面对困难乐观，有良好的社会适应性；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）身体健康长寿，日常生活活动正常；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）家庭关系和睦，心态乐观向上，人际关系良好；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）积极参加健身活动，能够长期坚持1－2项锻炼方法，在老同志健康活动中起带头作用，并能主动自愿带动其他老同志共同锻炼。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（三）关爱之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）具有一颗关爱他人，助人为乐的慈爱之心；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）踊跃加入各级关心下一代工作委员会组织，并积极参加各项活动；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）关心青少年的成长工作或结对助学等方面有突出表现；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）关爱青少年并积极帮助解决实际困难；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（5）邻里关系和睦，在离退休干部中发挥积极的团结作用。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">(</span></strong><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">四)奉献之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（1）大力弘扬“一方有难、八方支援”的革命传统和乐于奉献的社会风尚；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）发挥自身优势积极参加志愿者服务活动；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）热心社会公益事业，有扶贫帮困、爱心捐赠等方面有突出表现；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）带领身边同志积极帮助单位或支部其他需要帮助的老同志；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（五）家风之星</span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（1）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">以身作则，言传身教，</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">家庭幸福，夫妻互敬，子女孝顺；</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（2）自身身体健康，子女事业有成；</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（3）心态乐观向上，以自己的模范行为带动和影响自己子女，亲友和周围的人崇德向善。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(34, 34, 34); font-size: 20px; font-family: 宋体, SimSun;\">（4）家庭成员遵纪守法，有良好的道德风尚，邻里关系和睦。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><strong><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（六）参事之星 </span></strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">（1）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">自觉参加组织生活，在思想上、行动上与党中央和省、市委、医院党委保持高度一致。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">（2）真心实意为医院改革发展</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(34, 34, 34);\">建言献策、参与支部管理，在支部管理与建设中发挥积极作用；</span><strong> </strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; font-family: 宋体, SimSun;\"><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">（3）</span><span style=\"font-size: 20px; font-family: 宋体; color: rgb(81, 81, 81);\">积极乐观向上<strong>，</strong>保持党员先进本色，为稳定我院离退休干部队伍和谐稳定起着正面的积极作用。</span></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">三、评选推荐的办法和要求:</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\">1、评选推荐工作采取党员民主推荐、支委会评议的方式。此次表彰名额为每星2-3人</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\">2、凡推荐表彰的“正能量之星”离退休干部党员，均要认真“正能量之星先进事迹”登记表。</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\"> </span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\"></span></p><p style=\"line-height: 3em; text-indent: 2em; text-align: right;\"><span style=\"color: rgb(81, 81, 81); font-size: 20px; font-family: 宋体, SimSun;\">盐城市第一人民医院老干部支部</span></p><p style=\"line-height: 3em; text-indent: 2em; text-align: right;\"><span style=\"font-size: 20px; color: rgb(81, 81, 81); font-family: 宋体, SimSun;\"> 二O一八年十二月九日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2188','3008','1','','','：我院离退休党员同志为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果，回顾党的历史，增强对党的事业的感情，进一步提高我院离退休党员干部的综合素质，经院领导同意，在建党97周年到来之','192.168.162.110','192.168.162.110','1530547200','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体; font-size: 20px;\">：我院离退休党员同志</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">为深入推进我院离退休党员干部“进一步解放思想，激励新时代新担当新作为”学习教育活动，巩固大家一年来“两学一做”的学习成果</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">，回顾党的历史，增强对党的事业的感情，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体; background: white;\">进一步提高我院离退休党员干部的综合素质，</span><span style=\"text-indent: 2em; font-size: 19px; font-family: 宋体;\">经院领导同意，在建党97周年到来之际，决定在我院离退休党员中开展纪念建党周年知识竞赛活动。现将有关事项通知如下：</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">一、参赛人员</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">党组织关系在老干部支部的党员同志。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">二、竞赛时间</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">7月4日下午3：00—4：00。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><span style=\"font-size: 19px; font-family: 宋体; color: black; background: white;\">三、</span><strong><span style=\"font-size: 19px; font-family: 宋体;\">竞赛内容</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; color: black; background: white; font-size: 20px;\">以《中国共产党章程》、《中共党史》、习近平《新时代中国特色社会主义思想三十讲》等学习辅导材料内容为主。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">四、参赛方式</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 19px; font-family: 宋体;\">1、笔试题共25题，全部为选择题。集中学习时现场在试题答题。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-size: 20px;\"><strong><span style=\"font-size: 19px; font-family: 宋体;\">五、奖励办法</span></strong></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体; font-size: 20px;\">获奖奖项根据参赛者答题得分情况由高分到低分采取现场抽奖方式产生。竞赛设一、二、三等奖和纪念奖。其中一等奖2名，二等奖4名，三等奖6名，纪念奖若干。所有获奖人员都将获得相应的奖品。 </span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">市一院老干部支部</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体; font-size: 20px;\">二O一八年七月三日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2189','3009','1','','','：各位离退休老同志你们好！在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表','192.168.162.110','192.168.162.110','1520870400','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">你们好！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">在院领导的关心下，在体检中心的各位同仁的大力支持下，我院定于3月19日－3月24日为全院离退休职工安排一次健康检查。每位离退休职工的体检表和体检时间我们都已安排好，请各位老同志本人于3月16日前到院离退休干部处领取（原则上本次体检表不得代领，确有特殊情况需请人代领的同志，请代领人持被领人的身份证），请各位严格按照规定时间去完成体检。组织关系在老干部支部的党员同志来领体检表的时候请一并将2018年度的党费交纳一下！</span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">由于离退休职工人员较多，我们不再一一电话通知，凡看到通知的同志，敬请相互转告！谢谢！</span><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"></span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">市一院离退休干部处</span></p><p style=\"line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">2018年3月13日</span></p><p><br /></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2190','3010','1','','','：各位离退休老同志，你们好根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值','192.168.162.110','192.168.162.110','1519833600','<p style=\"line-height: 3em; text-indent: 0em;\" dir=\"rtl\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">：各位离退休老同志，你们好</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px; text-indent: 2em;\">根据国家计生委副主任崔丽同志在全国“两会”期间卫生计生系统安全稳定工作讲话精神要求，院党委充分认识到卫生计生系统安全生产形势的严峻性，立即召开医院安全工作会议，院领导就医院安全、消防安全、后勤保障、信访稳定、卫生应急、应急值守和信息报送等方面工作做了具体的要求。广大离退休老同志虽然离开了工作岗位，但安全与每个人的切身利益密切相关，大家应时刻紧绷安全意识这根弦。请大家自觉做好自身家庭安全隐患的排查工作，保证家里的水、电、气的安全，严防火灾；节日里各种美食诱人，大家要注意食品安全，保护身体健康；走亲访友出行要遵守交通规则，注意阴雨天的交通安全；不扬言滋事或参与大规模的聚集活动，不参与违法越级上访活动，远离非法聚众闹事；不在公共场合或网络上发布反动言论。如发现安全隐患，请及时与医院领导或老干部支部主动联系，以确保两会期间我院离退休干部队伍的稳定。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\">联系电话：13626200808 </span></p><p><br /></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 市一院离退休干部处</span></p><p style=\"text-indent: 2em; line-height: 3em; text-align: right;\"><span style=\"font-family: 宋体, SimSun; font-size: 20px;\"> 二O一八年三月一日</span></p><p><br /></p>','','','','','');
