font-family:宋体;color:#333333\">二、盐城市第一人民医院五官科医院门诊楼分体空调采购安装项目</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-indent:28.0pt;line-height:23.0pt;text-autospace:\r\nnone\"><span style=\"font-size:14.0pt;font-family:宋体;color:#333333\">中标单位：盐城市大拇指电器设备有限公司（品牌：海尔）</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:28.0pt;\r\nline-height:27.75pt\" align=\"left\"><span style=\"font-size:14.0pt;font-family:宋体;color:#333333\">中标价：<span>129999.00</span>元</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:27.75pt\" align=\"left\"><span style=\"font-size:14.0pt;font-family:宋体;\r\ncolor:#333333\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:27.75pt\" align=\"left\"><span style=\"font-size:14.0pt;font-family:宋体;color:#333333\">为体现公开、公平、公正的原则，特此公告三天。如有疑问请与盐城市第一人民医院监督审查室联系，电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:left;text-indent:24.0pt;\r\nline-height:27.75pt\" align=\"left\"><span style=\"font-size:14.0pt;font-family:宋体;\r\ncolor:#333333\">&nbsp;</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:right;text-indent:24.0pt;\r\nline-height:21.0pt\" align=\"right\"><span style=\"font-size:14.0pt;font-family:宋体;\r\ncolor:#333333\">&nbsp;</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:right;text-indent:24.0pt;\r\nline-height:21.0pt\" align=\"right\"><span style=\"font-size:14.0pt;font-family:宋体;color:#333333\">盐城市第一人民医院</span></p>\r\n<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';text-align:right;text-indent:24.0pt;\r\nline-height:21.0pt;word-break:break-all\" align=\"right\"><span style=\"font-size:\r\n14.0pt;font-family:宋体;color:#333333\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n&nbsp;&nbsp;&nbsp;2021</span><span style=\"font-size:14.0pt;font-family:宋体;\r\ncolor:#333333\">年<span>8</span>月<span>5</span>日 </span></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2227','3049','1','','','盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。1、项目概况1.1 项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；1.2项目地点：盐城市第一人民医院','192.168.162.110','192.168.162.110','1628128085','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">盐城市第一人民医院室内绿化招租及主院区绿化养护服务项目，资金已落实，招标人盐城市第一人民医院现对该项目进行公开招标，诚邀潜在的投标人参加投标。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、项目概况</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.1 </span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">项目名称：盐城市第一人民医院室内绿化招租及主院区绿化养护服务；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.2</span><span style=\"font-size:12.0pt;font-family:宋体\">项目地点：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:21.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3</span><span style=\"font-size:12.0pt;font-family:宋体\">招标内容：盐城市第一人民医院主院区室内绿化招租及绿化养护服务，招标人保留调整招标范围的权力，中标人须无条件服从。主要内容如下：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.1</span><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>1</span>）室内绿化招租范围：盐城市第一人民医院主院区、北区、五官科医院、紫薇门诊及皮肤科专科医院、盐城市儿童医院；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>2</span>）负责对摆放盆栽的运输、搬运、更换、日常养护及前期施工绿化景观养护等工作；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>3</span>）采购的各类盆栽应枝叶茂盛、修剪整齐；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.1pt;line-height:25.0pt\"><b><span style=\"font-size:12.0pt;font-family:宋体\">（<span>4</span>）</span></b><span style=\"font-size:12.0pt;font-family:宋体\">应根据招标人的要求、不同季节及植物的生长特性对盆栽及时更换；招标人认为盆栽不合格的，中标人须立即更换；更换期限为<span>24</span>小时，逾期一天每盆扣<span>50</span>元，依此类推；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>5</span>）所摆放的盆栽、绿化景观均由中标人派人员养护（含浇水、修建、整理），养护人员发生的一切问题和责任与招标人无关，相关的一切费用或民事、刑事责任均由中标人自行承担；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">（<span>6</span>）招标人如需临时在全院内增加盆栽（花），中标人须在<span>3</span>日内准备到位，经院方确认后按中标单价按实结算。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.3.2</span><span style=\"font-size:12.0pt;font-family:宋体\">绿化养护</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">室内绿化招租范围：盐城市第一人民医院主院区；绿化养护工作分为基本工作项目和定期工作项目等两部分。基本工作指一般性正常维护，即浇水、清理垃圾及零星病虫害防治、除杂草、清除病树、枯枝等；定期工作指每季度全面修建整形、施肥、除杂草、松土、全面病虫害防治及防寒涂白工作。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:36.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">工作要求：</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>1</span>）草坪高度应保持在<span>10-15cm</span>以内，每年修剪必须不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>2</span>）应对所有绿地进行彻底连根除草，消灭杂草乱生的现象，禁止喷洒除草药剂，每年除草必须不少于<span>5</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>3</span>）树木修剪包含乔木和灌木的整形修剪、抹芽、清理徒长枝、枯枝、病枝等，每年不少于<span>6</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>4</span>）应结合天气情况，每年<span>1-4</span>月份，如出现干旱，每月应至少浇水一次；每年<span>5-10</span>月份，应根据气温变化及时浇水，做好抗高温和抗旱工作；并在雨季期间做好排水措施；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>5</span>）在春季、秋季期间，对所有绿化全面施肥至少<span>2</span>次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>6</span>）病虫害防治工作应预防为主，要及时发现并立即处理病虫害；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>7</span>）针对超低温天气，须对特殊树木（如香樟）采取防寒措施；<span> </span></span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>8</span>）对主次干道行道树在每年秋季涂白一次；</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:宋体;color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt\">（<span>9</span>）绿化养护作业时，不得影响医院正常的医疗秩序。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">具体详见招标人的要求和工程量清单。</span><span style=\"font-size:12.0pt;font-family:宋体;color:black\">招标人保留调整绿化种类的权利，中标人须无条件服从。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-indent:24.0pt;line-height:25.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.4</span><span style=\"font-size:12.0pt;font-family:宋体\">服务期：<span> 3 </span>年，</span><span style=\"font-size:12.0pt;font-family:宋体\">合同按年签订。经招标人年度考核合格后，可续签下一年合同；考核不合格的，招标人</span><span style=\"font-size:12.0pt;font-family:宋体\">有权立即终止合同。</span><span style=\"font-size:\r\n12.0pt;font-family:宋体\">具体开始日期以招标人的书面通知为准。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2 </span></b><b><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有有效的含园林绿化经营范围的企业营业执照的独立法人。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.2</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须具备自营苗木花场场所并提供相关证明材料。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;font-size:10.5pt;font-family:\'Calibri\',\'sans-serif\';text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>5</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>8</span>月<span>10</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">5</span><span style=\"font-family:宋体;background:white\">、投标申请人有违反《盐城市市场廉政准则规定（试行）》中规定情形的，招标人将拒绝投标报名。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">6</span><span style=\"font-family:宋体;background:white\">、招投标监督管理机构及投诉电话：盐城市第一人民医院纪检监察室，联系电话<span>0515-66696810</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">其余内容详见招标文件。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp; </span><span style=\"font-family:宋体;background:white\">招标人：盐城市第一人民医院</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';text-align:right;background:white;word-break:break-all\" align=\"right\"><span style=\"font-family:宋体;background:white\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style=\"font-family:宋体;background:white\">时间：<span>2021</span>年<span>8</span>月<span>5</span>日<span>&nbsp; </span></span></p>\r\n<p></p>','','','','','');
INSERT INTO `p8_cms_item_article_addon` (`id`,`iid`,`page`,`addon_title`,`addon_frame`,`addon_summary`,`ip`,`last_update_ip`,`timestamp`,`content`,`custom_f`,`custom_g`,`custom_h`,`custom_i`,`custom_j`) VALUES ('2228','3050','1','','','盐城市第一人民医院主院区病房电视信号接入服务资金已落实，我院现拟对该项目进行公开招标，诚邀潜在的投标人参加投标，择优选择施工队伍。1、项目概况1.1 项目名称：盐城市第一人民医院主院区病房电视信号接入服务项目。1.2 服务地点：服务地点：盐城市第一人民医院主','192.168.162.110','192.168.162.110','1628128421','<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">盐城市第一人民医院主院区病房电视信号接入服务资金已落实，我院现拟对该项目进行公开招标，诚邀潜在的投标人参加投标，择优选择施工队伍。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">1</span></b><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">、项目概况</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.1 </span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">项目名称：</span><span style=\"font-size:12.0pt;font-family:宋体\">盐城市第一人民医院</span><span style=\"font-size:12.0pt;font-family:宋体\">主院区病房电视信号接入服务</span><span style=\"font-size:12.0pt;font-family:宋体\">项目</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-indent:24.0pt;line-height:22.0pt\"><span style=\"font-size:12.0pt;font-family:宋体\">1.2 </span><span style=\"font-size:12.0pt;font-family:宋体;color:windowtext\">服务地点</span><span style=\"font-size:12.0pt;font-family:宋体\">：</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">服务地点：</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;background:white\">盐城市第一人民医院主院区</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext;background:white\">（人民南路<span>66</span>号）</span><span style=\"font-size:12.0pt;font-family:宋体;color:windowtext\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">1.3</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体;color:windowtext\">招标内容：主盐城市第一人民医院主院区病房电视信号接入服务，确保医院内所有病房电视能收到信号，正常收看。<b>招标人仅提供电视机，不提供其他任何设备，投标人须自行勘察现场，了解现场具体情况，配备必要的设备及线路等。</b>信号源服务须至少提供<span>11</span>各电视信号频道和<span>5</span>个自建媒体播放频道，共计不少于<span>16</span>个电视频道。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.4</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">服务期：<span> 3 </span>年，</span><span style=\"font-size:12.0pt;\r\nfont-family:宋体\">合同按年签订，经采购人年度考核合格后，可续签下一年合同。具体开始日期以招标人的书面通知为准。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">1.5</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">发包方式：包工包料</span><span style=\"font-size:12.0pt;font-family:宋体\">。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:25.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">2 </span></b><b><span style=\"font-size:\r\n12.0pt;font-family:宋体;color:windowtext\">投标人应当具备的主要资格条件：</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.0pt;\r\nline-height:22.0pt;layout-grid-mode:char\" align=\"left\"><span style=\"font-size:\r\n12.0pt;font-family:宋体\">2.1</span><span style=\"font-size:12.0pt;font-family:\r\n宋体\">投标人须是具有《中华人民共和国基础电信业务经营许可证》的网络运营商的本地授权分支机构，或经营范围内含有“广播电视传输网络建设、改造、经营、维护和管理”的网络运营商的本地授权分支机构。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-align:justify;text-justify:inter-ideograph;text-indent:20.95pt;line-height:17.55pt;font-size:10.5pt;font-family:\'Times New Roman\',\'serif\';color:black;text-align:left;text-indent:24.1pt;\r\nline-height:21.0pt;layout-grid-mode:char\" align=\"left\"><b><span style=\"font-size:\r\n12.0pt;font-family:宋体\">3</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体\">、投标报名及招标文件的获取</span></b></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">请符合上述资质条件的投标人携带单位介绍信原件到江苏仁禾中衡工程咨询房地产估价有限公司造价二部（盐城市青年西路<span>8</span>号<span>8</span>楼<span>805</span>室）投标报名并领取招标文件，投标报名时间<span>2021</span>年<span>8</span>月<span>5</span>日<span>8</span>时<span>30</span>分至<span>2021</span>年<span>8</span>月<span>10</span>日<span>18</span>时。联系人：刘永杰，<span>0515-69057406</span>；手机：<span>13626222271</span>。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackground:white\"><span style=\"font-family:宋体;background:white\">4</span><span style=\"font-family:宋体;background:white\">、本项目采用“综合评估法”。</span></p>\r\n<p style=\"margin-right:0cm;margin-left:0cm;font-size:12.0pt;font-family:\'Calibri\',\'sans-serif\';margin:0cm;margin-bottom:.0001pt;text-indent:24.0pt;line-height:24.0pt;\r\nbackg